import { Link } from "react-router-dom";

import classes from "./MainNav.module.css";

function MainNav() {
  return (
    <header className={classes.header}>
      <div>MainNav</div>
      <nav>
        <ul>
        <li><Link to='/'>View All</Link></li>
          <li><Link to='/favorites'>Favorites</Link></li>
          
        </ul>
      </nav>
    </header>
  );
}

export default MainNav;
